import * as react from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const
    About = () => {
        const
            [shadow, setShadow] = react.useState(5);

        return (
            <>
                <Card
                    sx={{ minWidth: 275, maxWidth: '85%'}} 
                    elevation={shadow} 
                    onMouseEnter = {() => setShadow(10)}
                    onMouseLeave={()=>setShadow(5)} 
                    className ='BasicCard'
                >
                    <CardMedia
                        sx={{ height: 500 }}
                        image="/static/images/IMG-2217.jpg"
                        title="green iguana"
                    />
                    <CardContent>
                        <Typography gutterBottom variant="h4" component="div">
                            Hi There!
                        </Typography>
                        <Typography variant="body1" color="text.secondary">
                            I was born and raised here in Calgary, and currently I'm a student at the University of Calgary where I am studying software Engineering. This summer I wanted to spend some time learning new languages and experimenting with developing some apps. You can find some of my projects below! When I'm not learning new things or working, I like to spend my time learning Japanese, playing hockey, working out, working on my car, and playing around with linux.
                        </Typography>
                    </CardContent>
                    <CardActions>
                        <Button size="small">Share</Button>
                        <Button size="small">Learn More</Button>
                    </CardActions>
                </Card>
            </>
        )
    }

export {
    About
};
